INSERT INTO movies (id, title, synopsis, poster_img, backdrop_img, duration_minutes, release_date, director_id) OVERRIDING SYSTEM VALUE VALUES (1158166, 'A Big Gay Hairy Hit! Where the Bears Are: The Documentary', 'This hilarious and touching documentary tells the story of how three older, gay, "bears" working in Hollywood, tired of having their gay-themed ideas rejected by the mainstream, decided to self-produce their own web series. Against all odds, the comedy featuring three bear roommates like "The Golden Girls" solving crimes a la "Murder, She Wrote," became a sensation online and one of the most successful web shows of all time. The documentary examines ageism, body-shaming, sex-positivity, the creative process and how friendship and community can ultimately create something beloved all over the world.', '/g6VRpkGbbSm8i8rYdYJ1YfwvrC1.jpg', '/9Q7Q6B4hVE6DWl72m02mJceMCQS.jpg', 93, '2023-09-23', 1515236) ON CONFLICT (id) DO NOTHING;
